dataApp.run(["$rootScope","ngCart","ngCartItem","$http",function($rootScope,ngCart,ngCartItem,$http){$http.get("/cartAction/item?lang="+shopConf.lang+"&country="+shopConf.country).then(function(response){200!==response.status?(ngCart.init(),ngCart.loaded()):ngCart.restore(response.data)},function(response){ngCart.init()}),$rootScope.$on("ngCart:putItem",function(e,item,openModal){var data={item:new ngCartItem(item.getId(),item.getName(),item.getPrice(),item.getQuantity(),item.getPicture(),item.getData()),lang:shopConf.lang,country:shopConf.country};$http.put("/cartAction/item",data).then(function(response){var newItem=new ngCartItem(response.data.id,response.data.name,response.data.price,response.data.quantity,response.data.picture,response.data.data);ngCart.addItemByObject(newItem),openModal&&!0===openModal.enabled&&$rootScope.$broadcast("modal:"+openModal.id,newItem)},function(response){})}),$rootScope.$on("ngCart:postItem",function(e,item,openModal){var data={item:item,lang:shopConf.lang,country:shopConf.country};$http.post("/cartAction/item",data).then(function(response){var data=response.data.item;if(void 0!==response.data.vehicleList){var vehicleList=response.data.vehicleList;angular.merge($rootScope.vehicleList,vehicleList)}var newItem=new ngCartItem(data.id,data.name,data.price,data.quantity,data.picture,data.data);ngCart.addItemByObject(newItem),openModal&&!0===openModal.enabled&&$rootScope.$broadcast("modal:"+openModal.id,newItem)},function(response){})})}]);